Bruce enters Prof. Bryce's class and just stands there waiting for her to acknowledge him. She is very preoccupied, and after a minute, she asks what he is doing in her classroom. Its his weekly meeting he explains. She realizes it and profusely apologizes to him. It seems that she broke up with her boyfriend, and he had a lot of vices. Bruce is kinda nerdy and when she questions him about those vices, he doesn't do any of them. She gets up, backs him up against the wall, takes off his glasses, and decides to see what this nerdy kid has in his pants. WOAH! She is in for the ride of her life.
